import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';

function Profile() {

    const navigate = useNavigate();
    let [userData, setUserData] = useState(null)
    
   
    useEffect(() => {
        const callProfilePage = async () => {
            try {
    
                const response = await fetch('/profile', {
                    method: "GET",
                    headers: {
                        Accept: "application/json",
                        "Content-type": "applications/json"
    
                    },
                    credentials: "include"
                })
    
                const data = await response.json();
                setUserData(data);
    
                if (response.status !== 200) {
                    const err = new Error("Didn't get response");
                    throw err;
                }
            } catch (error) {
                console.log(error);
                navigate('/login')
            }
        }
        callProfilePage();
    }, [navigate])
    return (
        <>
            <section>
                <form method="GET" action='/profile'>
                    <div className="container py-5">
                       <center>
                        <div className="col">
                            <div className="col-lg-4">
                                <div className="card mb-4">
                                    <div className="card-body text-center">
                                        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.dreamstime.com%2Fillustration%2Fgender-neutral-avatar.html&psig=AOvVaw1OktMTKo1cQ3jj4wzjoOQI&ust=1729525878632000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCNDMv4ionYkDFQAAAAAdAAAAABAJ" alt="avatar" className="rounded-circle img-fluid" />
                                        <h5 className="my-3">{userData && userData.firstName} {userData && userData.lastName}</h5>                            
                                    </div>
                                </div>
                            </div>
                            <div className="col-lg-8">
                                <div className="card mb-4">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-sm-3">
                                                <p className="mb-0">Full Name</p>
                                            </div>
                                            <div className="col-sm-9">
                                                <p className="text-muted mb-0">{userData && userData.firstName} {userData && userData.lastName}</p>
                                            </div>
                                        </div>
                                        <hr />
                                        <div className="row">
                                            <div className="col-sm-3">
                                                <p className="mb-0">Email</p>
                                            </div>
                                            <div className="col-sm-9">
                                                <p className="text-muted mb-0">{userData && userData.email}</p>
                                            </div>
                                        </div>
                                        <hr />
                                        <div className="row">
                                            <div className="col-sm-3">
                                                <p className="mb-0">Phone</p>
                                            </div>
                                            <div className="col-sm-9">
                                                <p className="text-muted mb-0">{userData && userData.phone}</p>
                                            </div>
                                        </div>
                                        <hr />
                                        <div className="row">
                                                                   
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        </center> 
                    </div>
                </form>
            </section>
        </>
    )
}

export default Profile
